import React from 'react';
import '../../Navigation.css';
import border from '../../../../img/navBorder.png';

function NavBar() {
    return (
      <div className="navigation__container--navBar">
            <button><img src={border} alt="fa-bars" /></button>
            <h5>Home > Checkout</h5>
      </div>
    );
}

export default NavBar;
